INSERT INTO `global_property` VALUES ('application.name','OpenMRS','The name of this application, as presented to the user, for example on the login and welcome pages.','b3abef43-7d1d-453f-9a32-59f2121fee70',NULL,NULL,NULL,NULL),('concept.caseSensitiveNamesInConceptNameTable','true','Indicates whether names in the concept_name table are case sensitive or not. Setting this to false for MySQL with a case insensitive collation improves search performance.','299471e9-401f-49c5-92a8-73a1cfda9222',NULL,NULL,NULL,NULL),('concept.causeOfDeath','5002','Concept id of the concept defining the CAUSE OF DEATH concept','b3444b60-ff54-46b2-92fa-14f12d4d0b90',NULL,NULL,NULL,NULL),('concept.cd4_count','5497','Concept id of the concept defining the CD4 count concept','e06c23ee-2365-4d77-a876-925eab3b7510',NULL,NULL,NULL,NULL),('concept.defaultConceptMapType','NARROWER-THAN','Default concept map type which is used when no other is set','4c714a43-7d8b-44b0-b03e-f9009a66a2e6',NULL,NULL,NULL,NULL),('concept.false','2','Concept id of the concept defining the FALSE boolean concept','dd25fc18-b2f4-4ff7-b857-b5fd1066e384',NULL,NULL,NULL,NULL),('concept.height','23','Concept id of the concept defining the HEIGHT concept','d5a3d0b9-dd78-40bf-9e78-98290594ce38',NULL,NULL,NULL,NULL),('concept.medicalRecordObservations','1238','The concept id of the MEDICAL_RECORD_OBSERVATIONS concept.  This concept_id is presumed to be the generic grouping (obr) concept in hl7 messages.  An obs_group row is not created for this concept.','182350d4-f623-488c-84cd-8e1f67a7c5e2',NULL,NULL,NULL,NULL),('concept.none','1107','Concept id of the concept defining the NONE concept','270dfdc7-c670-436e-a060-3957f1331202',NULL,NULL,NULL,NULL),('concept.otherNonCoded','5622','Concept id of the concept defining the OTHER NON-CODED concept','e791af0c-715d-4af6-952b-49f868fe6af2',NULL,NULL,NULL,NULL),('concept.patientDied','1742','Concept id of the concept defining the PATIENT DIED concept','f30c3172-8f76-401d-8771-f2556d11c443