ame>d4T(40) + 3TC + EFV(600)</displayName>    <codeName>standardD4t40Efv</codeName>    <canReplace>ANTIRETROVIRAL DRUGS</canReplace>  </regimenSuggestion></list>','XML description of standard drug regimens, to be shown as shortcuts on the dashboard regimen entry tab','305e533a-eb1e-4c35-ada4-b1aea73cd9e8',NULL,NULL,NULL,NULL),('dashboard.relationships.show_types',NULL,'Types of relationships separated by commas.  Doctor/Patient,Parent/Child','38c7e176-12fe-436c-a20c-ca01c576ba00',NULL,NULL,NULL,NULL),('dashboard.showPatientName','false','Whether or not to display the patient name in the patient dashboard title. Note that enabling this could be security risk if multiple users operate on the same computer.','1ff44231-265a-4cc6-8dc9-1eba63bbe075','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('databasebackup.folderPath','backup','Path to the backup folder. You can either enter an absolute path \n            (i.e. \'C:/backup\') or a relative path (i.e. like the default value \'backup\') which is relative to the\n            OpenMRS application data directory.','05f20b2c-c18d-4b59-8553-9ec72d26e6aa',NULL,NULL,NULL,NULL),('databasebackup.mandatory','false','true/false whether or not the databasebackup module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','686c14ff-5bed-4a58-b8a3-b4a2b2c6b41e',NULL,NULL,NULL,NULL),('databasebackup.started','true','DO NOT MODIFY. true/false whether or not the databasebackup module has been started.  This is used to make sure modules that were running  prior to a restart are started again','75a73778-d353-4fb8-b47d-6a2cb2796eb9',NULL,NULL,NULL,NULL),('databasebackup.tablesExcluded','none','Enter the tables to be excluded from the backup comma separated (i.e.: hl7_in_archive, hl7_in_error) into field \'databasebackup.tablesExcluded\' or use \'all\' (default) to exclude all. If you don\'t want to exclude any tables, you could also leave it to the default value \'none\'.\nExplicitly entered table names overrule any eventual \'all\' or \'none\' entries in the opposite settings field.','0b485dd1-5443-48ee-85fc-ab2362e8ac5a',NULL,NULL,NULL,NULL),('databasebackup.tablesIncluded','all','Enter the tables to be included into the backup comma separated (i.e.: cohort, concept) into field \'databasebackup.tablesIncluded\' or use \'all\' (default) to include all.\nExplicitly entered table names overrule any eventual \'all\' or \'none\' entries in the opposite settings field.','69754c9f-e57b-4abb-b44a-188bdc20534a',NULL,NULL,NULL,NULL),('default_locale','en','Specifies the default locale. You can specify both the language code(ISO-639) and the country code(ISO-3166), e.g. \'en_GB\' or just country: e.g. \'en\'','fc621494-681e-4782-9980-c1e085c38354',NULL,NULL,NULL,NULL),('default_location','Unknown Location','The name of the location to use as a system default','5fbbc1c2-fc00-4e13-8242-602b137daa4b',NULL,NULL,NULL,NULL),('default_theme','green','Default theme for users.  OpenMRS ships with themes of \'green\', \'orange\', \'purple\', and \'legacy\'','0f405a5e-da75-4afd-bb18-90c3cfe514da',NULL,NULL,NULL,NULL),('encounterForm.obsSortOrder','number','The sort order for the obs listed on the encounter edit form.  \'number\' sorts on the associated numbering from the form schema.  \'weight\' sorts on the order displayed in the form schema.','84747a12-647e-49dc-8f28-2d77bb52513f',NULL,NULL,NULL,NULL),('EncounterType.encounterTypes.locked','false','saving, retiring or deleting an Encounter Type is not permitted, if true','6422325f-07f2-4996-a5d7-54a686832f48','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('FormEntry.enableDashboardTab','true','true/false whether or not to show a Form Entry tab on the patient dashboard','eb45903d-940c-4194-add7-3bb80c8be350','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('FormEntry.enableOnEncounterTab','true','true/false whether or not to show a Enter Form button on the encounters tab of the patient dashboard','719dd2a2-6d0a-4804-baab-527b0b94ff2d','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('formfilter.database_version','1.0-SNAPSHOT','DO NOT MODIFY.  Current database version number for the formfilter module.','4db8c004-4113-41d2-a0d7-b9fdc82026c1',NULL,NULL,NULL,NULL),('formfilter.mandatory','false','true/false whether or not the formfilter module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','fc7c2013-d098-45a5-aa8b-86d9da3c012f',NULL,NULL,NULL,NULL),('formfilter.started','true','DO NOT MODIFY. true/false whether or not the formfilter module has been started.  This is used to make sure modules that were running  prior to a restart are started again','55d8a9a3-247d-4bf0-9a19-41ece3faf162',NULL,NULL,NULL,NULL),('formFilter.useRoleInheritanceComparison','yes','Should we consider user role inheritance comparison ? (yes/no)','079d27f7-2d2f-4fa7-ad52-0fdd417a1251',NULL,NULL,NULL,NULL),('graph.color.absolute','rgb(20,20,20)','Color of the \'invalid\' section of numeric graphs on the patient dashboard.','6c931fd2-d8ae-424c-911d-72dbb5855fca',NULL,NULL,NULL,NULL),('graph.color.critical','rgb(200,0,0)','Color of the \'critical\' section of numeric graphs on the patient dashboard.','6a7bee06-7638-4ab7-ab40-6f92b9fbeb3f',NULL,NULL,NULL,NULL),('graph.color.normal','rgb(255,126,0)','Color of the \'normal\' section of numeric graphs on the patient dashboard.','7d88137c-c07b-440f-8946-4844469a83a7',NULL,NULL,NULL,NULL),('gzip.enabled','false','Set to \'true\' to turn on OpenMRS\'s gzip filter, and have the webapp compress data before sending it to any client that supports it. Generally use this if you are running Tomcat standalone. If you are running Tomcat behind Apache, then you\'d want to use Apache to do gzip compression.','54640d19-a149-42d8-bac7-e199ca9d828f','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('hl7_archive.dir','hl7_archives','The default name or absolute path for the folder where to write the hl7_in_archives.','6eaab485-ff6e-40b6-979b-6205ecfeb202',NULL,NULL,NULL,NULL),('hl7_processor.ignore_missing_patient_non_local','false','If true, hl7 messages for patients that are not found and are non-local will silently be dropped/ignored','648cf731-e6e3-49aa-97e7-acc8b00dbbfe','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('htmlformentry.database_version','1.2.0','DO NOT MODIFY.  Current database version number for the htmlformentry module.','0fc86b59-f196-417d-8be1-005251a75d29',NULL,NULL,NULL,NULL),('htmlformentry.dateFormat',NULL,'Always display dates in HTML Forms in this (Java) date format. E.g. \"dd/MMM/yyyy\" for 31/Jan/2012.','bdaa3061-0ba2-4f9b-9771-843c57d80cf8',NULL,NULL,NULL,NULL),('htmlformentry.datePickerYearsRange','110,20','datePickerYearsRange parameter can be  set here Eg:\'110,20\' meaning that the possible years that appear in the datepicker dropdown range from  20 years past the current year, and 110 years prior to the current year.','17698069-a544-4149-a4a1-9f04a702a0c1',NULL,NULL,NULL,NULL),('htmlformentry.mandatory','false','true/false whether or not the htmlformentry module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','0dc71439-96df-4ec5-92c0-e94a135ccc1d',NULL,NULL,NULL,NULL),('htmlformentry.showDateFormat','true','Set to true if you want static text for the date format to be displayed next to date widgets, else set to false.','1270ce7f-0cbc-490c-93c0-92acd75cd1a6',NULL,NULL,NULL,NULL),('htmlformentry.started','true','DO NOT MODIFY. true/false whether or not the htmlformentry module has been started.  This is used to make sure modules that were running  prior to a restart are started again','006ffb71-8865-45f0-88a2-328bc261c962',NULL,NULL,NULL,NULL),('htmlformentry19ext.mandatory','false','true/false whether or not the htmlformentry19ext module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','d9536ce1-a3e7-4c7d-803d-0c07ed627f51',NULL,NULL,NULL,NULL),('htmlformentry19ext.started','true','DO NOT MODIFY. true/false whether or not the htmlformentry19ext module has been started.  This is used to make sure modules that were running  prior to a restart are started again','40e0d24d-b275-4e90-8e8b-1b43a50ffcd1',NULL,NULL,NULL,NULL),('htmlformflowsheet.addAnotherButtonPosition','top','Lets you say where in the display to render the \'add another\' button.  Default is top.  Possible values:  top or bottom','22c16078-98ef-4fa6-9ee8-1e62db065980',NULL,NULL,NULL,NULL),('htmlformflowsheet.configuration',NULL,'flowsheets need these three items F (which stands for flowsheet) :Title:FormId\r\n        singletons need:           S:Title:FormId:Which         (where which is FIRST or LAST)\r\n        pipe delimited','563d56e4-2f60-4b0b-9b4c-c02cd28ad8b0',NULL,NULL,NULL,NULL),('htmlformflowsheet.drugDiscontinueReason',NULL,'The conceptId or UUID of the concept representing reasons for discontinuing a drug order.','bb018f0b-656d-4712-9d6d-5e5c90d8d07b',NULL,NULL,NULL,NULL),('htmlformflowsheet.encountersChronology','desc','Possible values here are desc and asc.  If not set, defaults to desc.','8a3d5969-69bf-4319-828b-9018e1172f48',NULL,NULL,NULL,NULL),('htmlformflowsheet.links',NULL,'links to appear at the top of the flowsheet.  Pipe delimited.  format is   name:link','14309698-ceed-458f-973b-3c6f112a9619',NULL,NULL,NULL,NULL),('htmlformflowsheet.mandatory','false','true/false whether or not the htmlformflowsheet module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','1472261c-7d33-4995-8f31-66c77d6b21b3',NULL,NULL,NULL,NULL),('htmlformflowsheet.patientChartFormIds',NULL,'Comma delimited formIds of all htmlform