'0f47875e-158a-468e-bb95-bb2db8cddbfb',NULL,NULL,NULL,NULL),('visits.autoCloseVisitType',NULL,'comma-separated list of the visit type(s) to automatically close','36dc0c63-1a1a-4da1-b12d-81b291ffc13f',NULL,NULL,NULL,NULL),('visits.enabled','true','Set to true to enable the Visits feature. This will replace the \'Encounters\' tab with a \'Visits\' tab on the dashboard.','7be5dfc5-9b36-4e7b-8883-be524eaf02b5','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('visits.encounterTypeToVisitTypeMapping',NULL,'Specifies how encounter types are mapped to visit types when automatically assigning encounters to visits. e.g 1:1, 2:1, 3:2 in the format encounterTypeId:visitTypeId','34c45c5f-cc52-4620-8c86-88e984c8b1d6',NULL,NULL,NULL,NULL),('webservices.rest.allowedips',NULL,'A comma-separate list of IP addresses that are allowed to access the web services. An empty string allows everyone to access all ws. \r\n        IPs can be declared with bit masks e.g. 10.0.0.0/30 matches 10.0.0.0 - 10.0.0.3 and 10.0.0.0/24 matches 10.0.0.0 - 10.0.0.255.','f1f63dfd-772b-44fc-a777-7ebcc78312ff',NULL,NULL,NULL,NULL),('webservices.rest.mandatory','false','true/false whether or not the webservices.rest module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','59072c50-dc31-4356-8749-8945992c66da',NULL,NULL,NULL,NULL),('webservices.rest.maxResultsAbsolute','1000','The absolute max results limit. If the client requests a larger number of results, then will get an error','8ef7cb50-e0aa-4036-9fc6-610b908a7f4a',NULL,NULL,NULL,NULL),('webservices.rest.maxResultsDefault','100','The default max results limit if the user does not provide a maximum when making the web service call.','02bc1f8f-dfce-4f2c-b4e9-39c5cc66218a',NULL,NULL,NULL,NULL),('webservices.rest.started','false','DO NOT MODIFY. true/false whether or not the webservices.rest module has been started.  This is used to make sure modules that were running  prior to a restart are started again','fc388014-0d4c-4764-85e6-0da3a1e2e81d',NULL,NULL,NULL,NULL),('webservices.rest.uriPrefix','https://202.141.249.106:8932/openmrs','The URI prefix through which clients consuming web services will connect to the web application, should be of the form http://{ipAddress}:{port}/{contextPath}','7f53fe40-2bbd-44af-bbe2-543218c432c0',NULL,NULL,NULL,NULL),('webservices.rest19ext.mandatory','false','true/false whether or not the webservices.rest19ext module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','fd1efbaf-d517-43dc-8d8c-643ead2c489f',NULL,NULL,NULL,NULL),('webservices.rest19ext.started','false','DO NOT MODIFY. true/false whether or not the webservices.rest19ext module has been started.  This is used to make sure modules that were running  prior to a restart are started again','8d21862b-9d7a-4802-b576-6f516106a787',NULL,NULL,NULL,NULL);
