INSERT INTO `htmlformentry_html_form` VALUES (1,2,NULL,'<htmlform>\r\n	<script type=\"text/javascript\">\r\n	<!-- Error Checking before Form Submit -->\r\n	beforeSubmit.push(function() {\r\n		// Validate barcode\r\n		var valid = true;\r\n		var error = \'\';\r\n		var barcode = getValue(\'barcode.value\');\r\n		if (barcode == null || barcode.length == 0) {\r\n			error += \'Barcode must be entered.\\n\';\r\n			valid = false;\r\n		}\r\n		if (barcode.length > 13) {\r\n			barcode = barcode.substring(0, 13);\r\n                        setValue(\'test_barcode.value\', barcode);\r\n			error += \'The barcode must be of 13 characters or less.\\n\';\r\n			valid = false;\r\n		}\r\n		if (valid == false) {\r\n			alert (error);\r\n		}\r\n        return valid;\r\n	});\r\n	</script>\r\n	<br/>\r\n	<!-- Autogenerated example form  (template from 01-Nov-2010 -->\r\n	<macros>\r\n		paperFormId = (Fill this in)\r\n		headerColor =#009d8e\r\n		fontOnHeaderColor = white\r\n	</macros>\r\n	<style>\r\n		.section {\r\n			border: 1px solid $headerColor;\r\n			padding: 2px;\r\n			text-align: left;\r\n			margin-bottom: 1em;\r\n		}\r\n		.sectionHeader {\r\n			background-color: $headerColor;\r\n			color: $fontOnHeaderColor;\r\n			display: block;\r\n			padding: 2px;\r\n			font-weight: bold;\r\n		}\r\n		table.baseline-aligned td {\r\n			vertical-align: baseline;\r\n		}\r\n	</style>\r\n\r\n	<span style=\"float:right\">Paper Form ID: $paperFormId</span>\r\n	<h2>Spirometry Form (v1.0)</h2>\r\n		<section headerLabel=\"1. Order\">\r\n			<htmlformflowsheet formId=\"7\" />\r\n		</section>\r\n		<section headerLabel=\"2. Results\">\r\n			<htmlformflowsheet formId=\"18\" />\r\n		</section>\r\n	<submit />\r\n</htmlform>',1,'2013-02-28 09:58:08',1,'2013-08-13 13:14:49',0,'7ef6a52c-6927-47e3-bcc1-0e84a7b2ebd6',NULL,NULL,NULL,NULL),(2,38,NULL,'<htmlform>\r\n	<!-- Autogenerated example form  (template from 01-Nov-2010 -->\r\n	<macros>\r\n		paperFormId = (Fill this in)\r\n		headerColor =#009d8e\r\n		fontOnHeaderColor = white\r\n	</macros>\r\n\r\n	<style>\r\n		.section {\r\n			border: 1px solid $headerColor;\r\n			padding: 2px;\r\n			text-align: left;\r\n			margin-bottom: 1em;\r\n		}\r\n		.sectionHeader {\r\n			background-color: $headerColor;\r\n			color: $fontOnHeaderColor;\r\n			display: block;\r\n			padding: 2px;\r\n			font-weight: bold;\r\n		}\r\n		table.baseline-aligned td {\r\n			vertical-align: baseline;\r\n		}\r\n	</style>\r\n\r\n	<span style=\"float:right\">Paper Form ID: $paperFormId</span>\r\n	<h2>Test Indication (v1.0)</h2>	\r\n	\r\n	<section headerLabel=\"2. Encounter Details\">\r\n		<table class=\"baseline-aligned\">\r\n				<tr>\r\n					<td>Form Date:</td>\r\n					<td><encounterDate default=\"today\"/></td>\r\n				</tr>\r\n				<tr>\r\n					<td>Location:</td>\r\n					<td><encounterLocation default=\"1\"/></td>\r\n				</tr>\r\n				<tr>\r\n					<td>Provider (Auto):</td>\r\n					<td><encounterProvider default=\"currentUser\" type=\"autocomplete\"/></td>\r\n				</tr>\r\n		</table>\r\n	</section>\r\n	<section headerLabel=\"2. Test Details\">\r\n		<table class=\"baseline-aligned\">\r\n		<div>\r\n			<p>\r\n				<lookup expression=\"fn.getConcept(\'68\').description\"/><br/>\r\n				<obs conceptId=\"68\" id=\"cxr\" defaultValue=\"2\" style=\"radio\"/>\r\n			</p>\r\n			<p>\r\n				<lookup expression=\"fn.getConcept(\'528\').description\"/><br/>\r\n				<obs conceptId=\"528\" id=\"ultrasound_abdomen\" defaultValue=\"2\" style=\"radio\"/>\r\n			</p>\r\n			<p>\r\n				<lookup expression=\"fn.getConcept(\'529\').description\"/><br/>\r\n				<obs conceptId=\"529\" id=\"ct_scan\" defaultValue=\"2\" answerConceptIds=\"2,1\" style=\"radio\"/>\r\n			</p>\r\n            <div id=\"ctscan_area\">\r\n				<p>\r\n				  <lookup expression=\"fn.getConcept(\'530\').description\"/><br/>\r\n				  <obs conceptId=\"530\" id=\"ct_scan_area\" />\r\n				</p>\r\n			</div>\r\n			<p>\r\n				<lookup expression=\"fn.getConcept(\'69\').description\"/><br/>\r\n				<obs conceptId=\"69\" id=\"gxp\" defaultValue=\"2\